import {dashboard, transactions, trend, expenses} from '../utils/Icons'

export const menuItems = [
    {
        id: 1,
        title: 'Dashboard',
        icon: dashboard,
        link: '/dashboard'
    },
    {
        id: 2,
        title: "Analytics",
        icon: trend,
        link: "/dashboard",
    },
    {
        id: 3,
        title: "Add Income",
        icon: transactions,
        link: "/dashboard",
    },
    {
        id: 4,
        title: "Add Expense",
        icon: expenses,
        link: "/dashboard",
    },
]
